! function () {
    "use strict";
    $(document).ready(function (e) {
        var i = e("#price-slider");
        i.slider({
            range: !0,
            min: 0,
            max: 100000,
            values: [0, 100000],
            slide: function (i, l) {
                e("#amount-min").html("&#8377;" + l.values[0]), e("#amount-max").html("&#8377;" + l.values[1]);
                    
            },
            
        }), e("#amount-min").html("&#8377;" + e("#price-slider").slider("values", 0)), e("#amount-max").html("&#8377;" + e("#price-slider").slider("values", 1));
    })
}();